import TeacherHeader from "./TeacherHeader";
import { useState, useEffect  } from "react";
import axios from "axios";
import { Link, useParams } from "react-router-dom";
import './TeacherMyCourses.css';

const baseUrl='http://127.0.0.1:8000/api';

function TeacherMyUsers() {

    useEffect(()=>{
        document.title='User List';
    });

    const [studentData, setStudentData] = useState([]);

    const teacherId=localStorage.getItem('teacherId');
    

   useEffect(()=>{
    try{
      axios.get(baseUrl + '/fetch-all-enrolled-users/'+ teacherId).then((res)=>{
        console.log(res.data);
        setStudentData(res.data);
      })
      }catch(error){
        console.log(error);
      }
}, []);
    


    return (
        <>
        <TeacherHeader />

<table className="table">
  <thead>
    <tr>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
{studentData.length > 0 && studentData.map((row, index) => 
  <tr key={index}>
    <td>{row.student && row.student.full_name}</td>
    <td>{row.student && row.student.email}</td>
    <td>{row.student && row.student.username}</td>
    <td><button>View</button></td>
  </tr>
)}
</tbody>
</table>
   
        </>
    );
}
export default TeacherMyUsers;
